DROP TABLE IF EXISTS `sys_user`;
CREATE TABLE `sys_user` (
  `id` varchar(64) COLLATE utf8_bin NOT NULL COMMENT '编号',
  `name` varchar(100) COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '姓名',
  `sys_type` varchar(10) COLLATE utf8_bin NOT NULL DEFAULT '0' COMMENT '人员系统类型标识（0:系统人员，1：企业人员）',
  `login_name` varchar(100) COLLATE utf8_bin NOT NULL COMMENT '登录名',
  `user_type` varchar(64) COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '用户角色',
  `password` varchar(100) COLLATE utf8_bin NOT NULL COMMENT '密码',
  `company_id` varchar(64) COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '所属公司',
  `office_id` varchar(64) COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '所属部门',
  `data_scope` varchar(64) COLLATE utf8_bin DEFAULT '0' COMMENT '支票数据操作权限（经办人or审核人）',
  `email` varchar(200) COLLATE utf8_bin DEFAULT NULL COMMENT '邮箱',
  `phone` varchar(200) COLLATE utf8_bin DEFAULT NULL COMMENT '电话',
  `mobile` varchar(200) COLLATE utf8_bin DEFAULT NULL COMMENT '手机',
  `photo` varchar(1000) COLLATE utf8_bin DEFAULT NULL COMMENT '用户头像',
  `login_ip` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '最后登陆IP',
  `login_date` datetime DEFAULT NULL COMMENT '最后登陆时间',
  `login_flag` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '是否可登录',
  `deviceid` varchar(255) COLLATE utf8_bin DEFAULT NULL,
  `mobileid` varchar(255) COLLATE utf8_bin DEFAULT NULL,
  `seid` varchar(255) COLLATE utf8_bin DEFAULT NULL,
  `bandstatus` int(1) DEFAULT NULL,
  `signature` varchar(255) COLLATE utf8_bin DEFAULT NULL,
  `gender` varchar(9) COLLATE utf8_bin DEFAULT NULL COMMENT '性别',
  `birthday` datetime DEFAULT NULL COMMENT '出生日期',
  `qq` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT 'QQ号码',
  `wechat` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '微信',
  `client_id` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '手机推送clientid',
  `usbkey_code` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '企业UsbKey',
  `create_by` varchar(64) COLLATE utf8_bin NOT NULL COMMENT '创建者',
  `create_date` datetime NOT NULL COMMENT '创建时间',
  `update_by` varchar(64) COLLATE utf8_bin NOT NULL COMMENT '更新者',
  `update_date` datetime NOT NULL COMMENT '更新时间',
  `remarks` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '备注信息',
  `del_flag` char(1) COLLATE utf8_bin NOT NULL DEFAULT '0' COMMENT '删除标记',
  PRIMARY KEY (`id`),
  KEY `sys_user_update_date` (`update_date`),
  KEY `sys_user_del_flag` (`del_flag`),
  KEY `sys_user_company_id` (`company_id`),
  KEY `sys_user_login_name` (`login_name`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='用户表';

-- ----------------------------
-- Records of sys_user
-- ----------------------------

