-- ----------------------------
-- Table structure for tb_cheque
-- ----------------------------
DROP TABLE IF EXISTS `tb_cheque`;
CREATE TABLE `tb_cheque` (
  `id` varchar(64) NOT NULL COMMENT 'id',
  `cheque_code` varchar(64) DEFAULT NULL COMMENT '支票编号',
  `cheque_type` int(11) DEFAULT NULL COMMENT '支票类型',
  `sign_unit_id` varchar(64) DEFAULT NULL COMMENT '签票企业编号',
  `sign_unit_name` varchar(200) DEFAULT NULL COMMENT '签票企业名称',
  `sign_bank_name` varchar(100) DEFAULT NULL COMMENT '签票银行名称',
  `sign_bank_address` varchar(200) DEFAULT NULL COMMENT '签票开户行',
  `sign_bank_account` varchar(50) DEFAULT NULL COMMENT '签票银行卡号',
  `amount` decimal(50,5) DEFAULT NULL COMMENT '签票金额',
  `max_amount` decimal(50,5) DEFAULT NULL COMMENT '最高限额',
  `sign_id` varchar(64) DEFAULT NULL COMMENT '签票人ID',
  `sign_name` varchar(100) DEFAULT NULL COMMENT '签票人名称',
  `cheque_use` varchar(255) DEFAULT NULL COMMENT '用途',
  `validity_date` int(11) DEFAULT NULL COMMENT '票据有效天数',
  `validity_start_date` datetime DEFAULT NULL COMMENT '票据有效期开始时间--以出票时间为准（按天算，当天算一天）',
  `maturity_date` int(11) DEFAULT NULL COMMENT '票据剩余天数',
  `is_endorse` varchar(10) DEFAULT NULL COMMENT '是否背书转让',
  `is_split` varchar(10) DEFAULT NULL COMMENT '是否支持拆分',
  `status` varchar(10) DEFAULT NULL COMMENT '状态(0:未流转；1：流转中；2流转结束；)',
  `create_by` varchar(64) DEFAULT NULL COMMENT '创建者',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(64) DEFAULT NULL COMMENT '更新者',
  `update_date` datetime DEFAULT NULL COMMENT '更新时间',
  `remarks` varchar(2000) DEFAULT NULL COMMENT '备注信息',
  `del_flag` char(1) NOT NULL COMMENT '删除标记',
  `is_assign_issuer` char(1) DEFAULT NULL COMMENT '是否指定出票人',
  `issuer` varchar(64) DEFAULT NULL COMMENT '出票人ID',
  `issuer_name` varchar(100) DEFAULT NULL COMMENT '出票人名称',
  `is_own` varchar(10) DEFAULT NULL COMMENT '票据所有状态',
